  Substance and other data from bottle casts in the Bering Sea from helicopter as
  part of Outer Continental Shelf Environmental Assessment Program (OCSEAP) from 16
  September 1976 to 20 September 1976 (NODC Accession 7700783)\",\n\t\"tracking_summary\":
